import React from "react";
import "bootstrap/dist/css/bootstrap.css";

export function Footer(): JSX.Element {
    return (
        <footer className="footer justify-content border-t py-3 my-4">
            <div className="container">
                <div className="row justify-content">
                    <div className="col-6 mb-0 text-muted align-self-center">This site was built from scratch in React!</div>
                    <div className="col-6 mb-0 text-muted align-self-center">
                        <a className="link-offset-2 link-offset-3-hover link-underline link-underline-opacity-0 link-underline-opacity-75-hover"
                            href="https://github.com/anishmukherjee123/anishmukherjee.info">
                            Repo available here.
                        </a>
                    </div>
                </div>
            </div>
        </footer>
    );
}
